\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B9_%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043a\u043e\u0440\u043e\u043b\u0435\u0439 \u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432\">\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC%D0%B8%D0%BD%D0%B0_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D0%B0_%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2)\" class=\"mw-redirect\" title=\"\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c\u0438\u043d\u0430 (\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432)\">\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c\u0438\u043d\u0430<\/a> \u043e\u0442\u043a\u0440\u044b\u0432\u0430\u0435\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D1%81%D1%82%D0%B5%D1%80%D0%B4%D0%B0%D0%BC\" title=\"\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c\">\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BC_%D0%A0%D0%B5%D0%BC%D0%B1%D1%80%D0%B0%D0%BD%D0%B4%D1%82%D0%B0\" class=\"mw-redirect\" title=\"\u0414\u043e\u043c \u0420\u0435\u043c\u0431\u0440\u0430\u043d\u0434\u0442\u0430\">\u043d\u043e\u0432\u044b\u0439 \u043c\u0443\u0437\u0435\u0439<\/a>&#160;\u2014 \u0414\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BC%D0%B1%D1%80%D0%B0%D0%BD%D0%B4%D1%82\" title=\"\u0420\u0435\u043c\u0431\u0440\u0430\u043d\u0434\u0442\">\u0420\u0435\u043c\u0431\u0440\u0430\u043d\u0434\u0442\u0430<\/a>. \u0414\u043e\u043c, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a \u043f\u0440\u043e\u0436\u0438\u043b \u0434\u0432\u0430\u0434\u0446\u0430\u0442\u044c \u043b\u0435\u0442 \u043f\u043e\u0441\u043b\u0435 \u0436\u0435\u043d\u0438\u0442\u044c\u0431\u044b \u043d\u0430 \u0421\u0430\u0441\u043a\u0438\u0438 \u0438 \u0433\u0434\u0435 \u043e\u043d \u0441\u043e\u0437\u0434\u0430\u043b \u0442\u0430\u043a\u0438\u0435 \u0448\u0435\u0434\u0435\u0432\u0440\u044b, \u043a\u0430\u043a \u00ab\u041d\u043e\u0447\u043d\u043e\u0439 \u0434\u043e\u0437\u043e\u0440\u00bb, \u043a \u043d\u0430\u0447\u0430\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/XX_%D0%B2%D0%B5%D0%BA\" title=\"XX \u0432\u0435\u043a\">XX \u0432\u0435\u043a\u0430<\/a> \u043f\u0440\u0438\u0448\u0451\u043b \u0432 \u043f\u043e\u043b\u043d\u044b\u0439 \u0443\u043f\u0430\u0434\u043e\u043a. \u041f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u0447\u0435\u0442\u044b\u0440\u0435 \u0433\u043e\u0434\u0430 \u0443\u0441\u0438\u043b\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D1%82%D0%B0%D0%B2%D1%80%D0%B0%D1%82%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u0420\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0442\u043e\u0440\">\u0440\u0435\u0441\u0442\u0430\u0432\u0440\u0430\u0442\u043e\u0440\u043e\u0432<\/a>, \u0447\u0442\u043e\u0431\u044b \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u044c \u0441\u0442\u0440\u043e\u0435\u043d\u0438\u0435 \u0438 \u0443\u0441\u0442\u0440\u043e\u0438\u0442\u044c \u0432 \u043d\u0451\u043c \u043c\u0443\u0437\u0435\u0439 \u043e\u0434\u043d\u043e\u0433\u043e \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u0432 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0436\u0438\u0432\u043e\u043f\u0438\u0441\u0446\u0435\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u044b \u043c\u0430\u0441\u0442\u0435\u0440\u0441\u043a\u0438\u0435 \u041b\u0430\u0442\u0432\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0434\u0435\u043f\u0430\u0440\u0442\u0430\u043c\u0435\u043d\u0442\u0430 \u043f\u043e\u0447\u0442 \u0438 \u0442\u0435\u043b\u0435\u0433\u0440\u0430\u0444\u0430 \u0441 \u043f\u044f\u0442\u044c\u044e \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u0430\u043c\u0438. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932 \u0433\u043e\u0434\u0443<\/a> \u043d\u0430 \u0438\u0445 \u0431\u0430\u0437\u0435 \u0431\u0443\u0434\u0435\u0442 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%AD%D0%A4_(%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u042d\u0424 (\u041b\u0430\u0442\u0432\u0438\u044f)\">\u0437\u0430\u0432\u043e\u0434 VEF<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u0422\u0443\u043b\u044c\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u0422\u0443\u043b\u044c\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u043c\u0443\u0437\u0435\u0439-\u0443\u0441\u0430\u0434\u044c\u0431\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BB%D1%81%D1%82%D0%BE%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0422\u043e\u043b\u0441\u0442\u043e\u0439, \u041b\u0435\u0432 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u041b\u044c\u0432\u0430 \u0422\u043e\u043b\u0441\u0442\u043e\u0433\u043e<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D1%81%D0%BD%D0%B0%D1%8F_%D0%9F%D0%BE%D0%BB%D1%8F%D0%BD%D0%B0\" title=\"\u042f\u0441\u043d\u0430\u044f \u041f\u043e\u043b\u044f\u043d\u0430\">\u042f\u0441\u043d\u0430\u044f \u041f\u043e\u043b\u044f\u043d\u0430<\/a>\u00bb. \u041f\u0438\u0441\u0430\u0442\u0435\u043b\u044c \u043f\u0440\u043e\u0436\u0438\u043b \u0432 \u042f\u0441\u043d\u043e\u0439 \u041f\u043e\u043b\u044f\u043d\u0435 \u043e\u043a\u043e\u043b\u043e 60 \u043b\u0435\u0442, \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u0437\u0434\u0435\u0441\u044c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B8_%D0%BC%D0%B8%D1%80\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0438 \u043c\u0438\u0440\">\u0412\u043e\u0439\u043d\u0443 \u0438 \u043c\u0438\u0440<\/a>\u00bb, \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%B5%D0%BD%D0%B8%D0%BD%D0%B0\" title=\"\u0410\u043d\u043d\u0430 \u041a\u0430\u0440\u0435\u043d\u0438\u043d\u0430\">\u0410\u043d\u043d\u0443 \u041a\u0430\u0440\u0435\u043d\u0438\u043d\u0443<\/a>\u00bb \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f<\/a> \u043f\u043e\u043a\u0438\u043d\u0443\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org