438\u0435 \u0438\u0433\u0440\u044b 1956\">XVI \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440<\/a> (\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0438<\/a> \u0440\u0435\u0448\u0435\u043d\u043e \u0431\u044b\u043b\u043e \u043f\u0440\u043e\u0432\u0435\u0441\u0442\u0438 \u0442\u0443\u0440\u043d\u0438\u0440 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%BF%D0%BE%D1%80%D1%82\" title=\"\u041a\u043e\u043d\u043d\u044b\u0439 \u0441\u043f\u043e\u0440\u0442\">\u043a\u043e\u043d\u043d\u043e\u043c\u0443 \u0441\u043f\u043e\u0440\u0442\u0443<\/a>, \u0430 \u0441\u0430\u043c\u0438 \u0418\u0433\u0440\u044b \u043d\u0430\u0447\u0430\u043b\u0438\u0441\u044c \u0432 \u043d\u043e\u044f\u0431\u0440\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BB%D1%8C%D0%B1%D1%83%D1%80%D0%BD\" title=\"\u041c\u0435\u043b\u044c\u0431\u0443\u0440\u043d\">\u041c\u0435\u043b\u044c\u0431\u0443\u0440\u043d\u0435<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-14_%D0%BF%D0%BE%D0%B4_%D0%A2%D0%BA%D0%B2%D0%B0%D1%80%D1%87%D0%B5%D0%BB%D0%B8\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u043f\u043e\u0434 \u0422\u043a\u0432\u0430\u0440\u0447\u0435\u043b\u0438\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u043f\u043e\u0434 \u0422\u043a\u0432\u0430\u0440\u0447\u0435\u043b\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D1%85%D0%B0%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%B2%D1%82%D0%BE%D0%BD%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1